    window.testVCF = async function(maxVCF = 1, maxDepth = 90, maxNode = 30000) {
        try {
            let sTime = new Date().getTime(),
                testNum = vcfList.length,
                succeedCount = 0,
                depth30Count = 0,
                depth50Count = 0,
                depth100Count = 0,
                depth180Count = 0,
                blackCount = 0,
                ps = [];

            window.openNoSleep();
            console.warn(`VCF测试: ${engine.MAX_THREAD_NUM}线程`);
            for (let i = 0; i < testNum; i++) {
                let thread = await engine.getFreeThread(),
                    test = vcfList[i];
                ps.push(engine.findVCF({ arr: test.arr, color: test.color, maxVCF: maxVCF, maxDepth: maxDepth, maxNode: maxNode }, thread)
                    .then(vcfInfo => {
                        let winMoves = vcfInfo.winMoves;
                        console.log(`第${("000" + i.toString(10)).slice(-3)}题: ${winMoves.length?"成功":"失败"}\ncolor: ${vcfInfo.color}\npushMoveCount: ${vcfInfo.pushMoveCount}\npushPositionCount: ${vcfInfo.pushPositionCount}\nhasCount: ${vcfInfo.hasCount}\nnodeCount: ${vcfInfo.nodeCount}`);
                        if (winMoves.length) {
                            vcfList[i].moves = winMoves[0].slice(0);
                            console.warn(movesToName(winMoves[0], 600));
                            if (winMoves[0].length < 30) depth30Count++;
                            else if (winMoves[0].length < 50) depth50Count++;
                            else if (winMoves[0].length < 100) depth100Count++;
                            else depth180Count++;
                            succeedCount++;
                        }
                    }))
            }

            Promise.all(ps)
                .then(() => {
                    engine.cancel();
                    window.closeNoSleep();
                    console.log(`测试结束: ${testNum}道VCF, 黑先: ${blackCount}题 + 白先: ${testNum - blackCount}题\n 
                        成功: ${succeedCount}题\n 30手内: ${depth30Count}题 + 50手内: ${depth50Count}题 + 100手内: ${depth100Count}题 + >=100手: ${depth180Count}题\n
                        失败: ${testNum - succeedCount}题\n
                        成功率: ${~~((succeedCount/testNum)*10000)/100}%\n
                        用时: ${~~((new Date().getTime()-sTime)/1000) + 1}秒\n
                        平均时间: ${~~((new Date().getTime()-sTime)/testNum)}毫秒`);
                })
        }
        catch (err) {
            alert(err.message)
        }
    }

