    function testIf(value, value1) {
        if (value == 0) {
            return false;
        }
        else if (value == 1 && 1 == value1) {
            return true;
        }
        else if (value == 2 && 2 == value1) {
            return true;
        }
        else if (value == -1) {
            return false;
        }
        return false;
    }

    function testSwitch(value, value1) {
        switch (value) {
            case 0:
                return false;
                break;
            case 1:
                if (1 == value1) return true;
                else return false;
                break;
            case 2:
                if (2 == value1) return true;
                else return false;
                break;
            case -1:
                return false;
                break;
            default:
                return false;
        }
    }

